export function getVideogames() {
    return function (dispatch) {
      return fetch(`http://localhost:3001/videogames`)
        .then(response => response.json())
        .then(json => {
          dispatch({ type: "GET_VIDEOGAMES", payload: json });
        });
    };
  }
